import React from 'react';


function SquareList(props) {
  const current = props.mark //array of marks
  let squarelist = [];
  for(let i=0; i<9; i++) {
    squarelist.push(
      <li key={i}><Square
        mark={current[i]}
        onClick={props.onClick(i)}
      />
      </li>) 
  }

  return (
    <div className='square-container'>
      hello
    </div>
  );
}

export default SquareList;


